import React,{useState, useEffect} from 'react';
import './profile.css';
import SideNavbar from '../../components/SideNavbar/sideNavbar';
import ArrowRightIcon from '@mui/icons-material/ArrowRight';
import {Link, useParams} from 'react-router-dom';
import axios from 'axios';

const Profile = ({sideNavbar}) => {
  const {id} = useParams();
  const [data, setData] = useState([]);
  const [user, setUser] = useState(null);
  const fetchProfileData = async () => {
    axios.get(`http://localhost:4000/api/${id}/channel`).then((response) => {
      console.log(response);
      setData(response.data.video);
      setUser(response.data.video[0]?.user);
    }).catch(err => {
      console.log(err);
    })
  }
  useEffect(() => {
    fetchProfileData();
  },[])

  return (
    <div className='profile'>
      <SideNavbar sideNavbar={sideNavbar}/>

      <div className={sideNavbar ? 'profile_page':'profile_page_inactive'}>
          <div className='profile_top_section'>
            <div className='profile_top_section_profile'>
              <img className='profile_top_section_img' src='https://imgs.search.brave.com/s7h4GwPFE3nOh8I-uZHXR22kIbzwafCF_Bye8A6B0io/rs:fit:860:0:0:0/g:ce/aHR0cHM6Ly93d3cu/aXN0b2NrcGhvdG8u/Y29tL3Jlc291cmNl/cy9pbWFnZXMvUGhv/dG9GVExQL0xpZmVz/dHlsZS0xMDMzNDU3/MjUwLmpwZw'/>
            </div>
            <div className='profile_top_section_about'>
              <div className='profile_top_section_about_name'>{user?.channelName}</div>
              <div className='profile_top_section_info'>
                {user?.userName}  . {} videos
              </div>
              <div className='profile_top_section_info'>
                About section of channel
              </div>
            </div>
          </div>
          <div className='profile_videos'>
            <div className='profile_video_title'>
              Videos &nbsp; <ArrowRightIcon/>
            </div>
            <div className='profileVideos'>
              <div className='profileVideo_block'>
                <div className='profileVideo_block_thumbnail'>
                  <img className='profileVideo_block_thumbnail_img' src='https://imgs.search.brave.com/s7h4GwPFE3nOh8I-uZHXR22kIbzwafCF_Bye8A6B0io/rs:fit:860:0:0:0/g:ce/aHR0cHM6Ly93d3cu/aXN0b2NrcGhvdG8u/Y29tL3Jlc291cmNl/cy9pbWFnZXMvUGhv/dG9GVExQL0xpZmVz/dHlsZS0xMDMzNDU3/MjUwLmpwZw'/>
                </div>
                <div className='profileVideo_block_details'>
                  <div className='profileVideo_block_details_name'>Video Title</div>
                  <div className='profileVideo_block_details_about'>Create at 2024-09-12</div>
                </div>
              </div>
            </div>
            
          </div>
      </div>
    </div>
  )
}

export default Profile;
